import React from 'react';
import BigDiv from './Bigdiv';
import SmallDiv from './Smalldiv';

function MultiDiv() {
    return (
        <React.Fragment>
        <h1>BBC-NEWS</h1>
        <BigDiv/>
        <SmallDiv/>
        </React.Fragment>
    )
}

export default MultiDiv;
